import { Card } from 'antd';
import {} from '@ant-design';

const PostCard = ({ post }) => {
    return (
        <div>
            <Card cover={post.Images[0] && <PostImages images={post.images} actions={[<RetweetOutlined />]} />}>
                <Image />
                <Content />
                <Button></Button>
            </Card>
            <CommentForm />
            <Comment />
        </div>
    );
};

export default PostCard;
